<script src=""https://maps.googleapis.com/maps/api/js?key=AIzaSyDUo7ytcLrd9qif4T7PDVF-XKUNdOeojpY&libraries=places&callback=initMap""
async defer></script>
<script type=""text/javascript"">

var $location;
var $latitude;
var $longitude;
var $map;
var $blood;
var SetField=()=>{
	$location=document.getElementById(""Location"");
	$latitude=document.getElementById(""Latitude"");
	$longitude=document.getElementById(""Longitude"");
	$map=document.getElementById(""map"");
	$blood=document.getElementById(""BloodGroup"");
}
var initMap=()=>{
	SetField();
	var places = new google.maps.places.Autocomplete($location);
	google.maps.event.addListener(places, 'place_changed', function() {
		var place = places.getPlace();
		var address = place.formatted_address;
		
		var latitude = place.geometry.location.lat()
		var longitude = place.geometry.location.lng();

		$latitude.value=latitude;
		$longitude.value=longitude;
	});
	google.maps.event.addDomListener($location, 'keydown', function(event) { 
		if (event");
                WriteLiteral(@".keyCode === 13) { 
			event.preventDefault(); 
		}
	}); 
}

var ShowMap=()=>{
	SetField();
	var latitude= $latitude.value||28.394857;
	var longitude=$longitude.value||84.124008;

	latitude=parseFloat(latitude);
	longitude=parseFloat(longitude);

	var myPos = {lat:latitude , lng:longitude };

	var map = new google.maps.Map($map,{
		zoom: 10,
		center: myPos   
	});
    var marker = new google.maps.Marker({
		position: myPos,
		draggable:true,
		title:$blood.value+"" Blood""
	});
	marker.setMap(map);
	google.maps.event.addListener(marker, 'dragend', function(evt){
		SetField();
        var geocoder = new google.maps.Geocoder();
        geocoder.geocode({
        latLng: marker.getPosition()
        }, function(responses) {
            if (responses) {
            $location.value=(responses[0].formatted_address);
        } 
    });


		$latitude.value=evt.latLng.lat();
		$longitude.value=evt.latLng.lng();
	});
};
$(document).ready(function(){
	SetField();
	if (navigator");
                WriteLiteral(".geolocation) {\r\n\t\tnavigator.geolocation.getCurrentPosition(function showPosition(position) {\r\n\t\t\t$latitude.value=position.coords.latitude ;\r\n\t\t\t$longitude.value=position.coords.longitude;\r\n\t\t});\r\n\t} \r\n});\r\n</script>\r\n");
                EndContext();
            }
            );
